script: |
  super -f tsv -I q9233.sql | sort > q9233.out

vector: true

inputs:
  - name: q9233.sql
    data: |
      SELECT DISTINCT - ( - MIN ( 50 ) ) AS col2 FROM tab0 WHERE + col2 + + CAST ( - col0 AS INTEGER ) NOT BETWEEN - col2 * - - 47 + - 76 - col2 * - col0 AND + + 0 + - 0;
  - name: tab0

outputs:
  - name: q9233.out
    data: |
      50
